// React imports
import React from "react";
import ReactDOM from "react-dom";
import { Routes, Route, Link } from "react-router-dom";
import HomePage from "./Pages/HomePage";
import Registration from "./Pages/Registration";
import Crown from "@govuk-react/icon-crown";

// GovUK imports
import {
  TopNav,
  Footer,
  PhaseBanner,
  Breadcrumbs,
  Panel,
  Button,
} from "govuk-react";

// Custom imports

function App() {
  return (
    <div>
      <TopNav
        company={
          <TopNav.Anchor href="https://example.com" target="new">
            <TopNav.IconTitle icon={<Crown height="32" width="36" />}>
              GOV.UK
            </TopNav.IconTitle>
          </TopNav.Anchor>
        }
        serviceTitle={
          <TopNav.NavLink href="https://example.com" target="new">
            Group E - Web Application
          </TopNav.NavLink>
        }
      >
        <TopNav.NavLink href="">
          <Link to="/" style={{ color: "white" }}>
            Home
          </Link>
        </TopNav.NavLink>
        <TopNav.NavLink href="https://example.com?q=dogcat">
          Login
        </TopNav.NavLink>
        <TopNav.NavLink href="">
          <Link to="/Registration" style={{ color: "white" }}>
            Register
          </Link>
        </TopNav.NavLink>
      </TopNav>
      {/* route for the links to different pages */}
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/Registration" element={<Registration />} />
      </Routes>

      <Footer>
        <Footer.Link href="#">Terms and conditions&nbsp;</Footer.Link>
        <Footer.Link href="#">Privacy policy&nbsp;</Footer.Link>
        <Footer.Link href="#">Accessibility statement</Footer.Link>
      </Footer>
    </div>
  );
}

export default App;
